import React, { useState, useEffect } from "react";
import { Images } from "./Images";

export default function Cards() {
  const [image, setImages] = useState();

  useEffect(() => {
    setImages(Images);
  });

  console.log(Images);
  return (
    <div>
      <img src={(image.navItemPath, image.navItemName)} alt='' />
    </div>
  );
}
